package jala.Corejava.basics;

public class Continue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    for(int i=0;i<=100;i++) {
    	if(i%13==0) {
    		if(i==65) {
    			continue;
    			
    		}
    	System.out.println(i);
    	
    	}
    	
    	
    }
	}

}
